import request from '@/api/request'

//获取登录二维码key
export function getqrKey(){
	return request({
		method:'get',
		url:'/login/qr/key',
	})
}
//通过二维码key返回生成二维码
export function getqrImg(params){
	return request({
		method:'get',
		url:'/login/qr/create',
		params:params,
	})
}
